import Tabla from "./Tabla";

function Usuarios() {
    if (localStorage.getItem('privilegio') === '1') {
        return [
            <div>
              <Tabla filas_por_pagina={4} tabla={'usuarios'}></Tabla>
            </div>
        ];
    } else {
        Toast.success(
            'No tenes permisos para acceder aca',
              {
                duration: 2000,
              }
            );
        window.location = 'http://localhost:3000/Libros';
    }

}

export default Usuarios;
